DROP TABLE IF EXISTS "equipos";
CREATE TABLE 'equipos' (
  `Id` integer  auto_increment,
  `patente` varchar(50) ,
  `cod_radial` varchar(50)  ,
  `propietario` integer,
  `tipo_equipo` varchar(100) ,
  `marca` varchar(50) ,
  `modelo` varchar(50) ,
  `anio` integer ,
  `volumen` integer ,
  `valor_hora` double ,
  `miselaneo` varchar(50) ,
  `estado` integer ,
  `cons_hora` double ,
  `rend_km` double,
  PRIMARY KEY  (`Id`)
);
